import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { endpoints, enviroment as env } from 'src/enviroment';
import { Observable, map } from 'rxjs';
import { ParticipanteResponse } from '../models/participantes.interface';
import { BaseApiResponse } from 'src/app/shared/models/base-api-response.interface';

@Injectable({
  providedIn: 'root'
})
export class PaticipantesService {

  constructor(private _http: HttpClient) { }

  participantesList(): Observable<BaseApiResponse> {
    const requestUrl = `${env.api}${endpoints.PARTICIPANTES_LIST}`;
    return this._http.get<BaseApiResponse>(requestUrl).pipe(
      map((response: BaseApiResponse) => {
        return response.data;
      })
    )
  }
}
